tables.table_schema:
CREATE TABLE clubs (
   id INT PRIMARY KEY,
   name VARCHAR(255),
   price DECIMAL(10, 2),
   availability BOOLEAN
);

CREATE TABLE balls (
   id INT PRIMARY KEY,
   name VARCHAR(255),
   price DECIMAL(10, 2),
   availability BOOLEAN
);

CREATE TABLE customers ( 
  customer_id SERIAL PRIMARY KEY, 
  customer_name VARCHAR(100) NOT NULL, 
  customer_email VARCHAR(100) NOT NULL, 
  customer_phone VARCHAR(20) 
);
